import React from 'react';

import {Link} from 'react-router-dom';

import './status-filter.scss';

const StatusFilter =()=>{
    return (
      <div className="filter-bar row">
        <Link   to='/'
                type="button"
                className="filter-bar-all btn btn-info col-sm">All</Link>
        <Link   to='/active'
                type="button"
                className="filter-bar-active btn btn-outline-secondary col-sm">Active</Link>
        <Link   to='/done'
                type="button"
                className="filter-bar-done btn btn-outline-secondary col-sm">Done</Link>
      </div>
    );
}

export default StatusFilter;
